import * as commonStyles from './App.css'
import * as classnames from 'classnames/bind';
const cx = classnames.bind(commonStyles);


function App() {
  return (
    <div className="App">
      <div className={cx('top-bar-div')}>
        <div>setting</div>
        <div>PlayerInfo</div>
        <div>View Select</div>
      </div>
      <div>QuickLinks</div>
      <div>
        <div>LeftBar</div>
        <div>MiddleBar</div>
        <div>
          <div>rightbar1</div>
          <div>rightbar2</div>
        </div>
      </div>
    </div>
  );
}

export default App;
